	{ skill: 'JavaScript', icon: 'fab fa-js-square' },
	{ skill: 'HTML', icon: 'fab fa-html5' },
	{ skill: 'CSS', icon: 'fab fa-css3-alt'},
	{ skill: 'Jquery' },
	{ skill: 'Bootstrap', icon: 'fab fa-bootstrap' },
	{ skill: 'MongoDB', icon: 'fas fa-database'},
	{ skill: 'Mongoose' },
