	{ skill: 'JSON' },
	{ skill: 'MERN' },
	{ skill: 'Git' },
	{ skill: 'Github', icon: 'fab fa-github' },
];



const colors = ['#0088FE', '#00C49F', '#FFBB28', '#FF8042', '#c7f2cc', '#e3c6f0', '#fdd0e4', '#baf6ff'];

class Skills extends React.Component {
	render() {
		return (
			<div>
